import React from 'react';
import './About.css';

function Header() {
  return (
    <header className="header">
      <h1>alyssa anastasi</h1>
      <p>current senior in computer science and statistics with a minor in public health at uiuc with a passion for applying machine learning in healthcare</p>
    </header>
  );
}

export default Header;
